import React from 'react';
import Home from './Home';
import Service from './Service';
import Contact from './Contact';
import Footer from './Footer';
import './App.css';
import Button from 'react-bootstrap/Button';

import{Route,BrowserRouter as Router,Switch,Link,Redirect} from 'react-router-dom';



const App=()=>{

  return(

<body>

<section id="nav">
<a id='a1'>HariCharan</a>
<Router>
<a id='a2'><Link to='/' style={{textDecoration:'none',marginLeft:'300px'}}>Home</Link></a>
<a id='a3'><Link to='/Service' style={{textDecoration:'none'}}>Service</Link></a>
<a id='a4'><Link to='/Contact' style={{textDecoration:'none'}}>Contact</Link></a>
<br></br>

<Switch>
<Route exact path="/" component={Home}/>
<Route exact path="/Service" component={Service}/>
<Route exact path="/Contact" component={Contact}/>
<Redirect to='/' />

</Switch>
</Router>
</section>
<div>
  <Footer />
</div>
<div>
 <Button>click</Button>
</div>
</body>

  );
  }
export default App;
